isHomepage = false;

function onpagescroll(){
	if($(window).scrollTop() > 50){
		$('.empty-logo-bar').css('display', 'block');
		
		if($(".persistant-bar")[0]){
			$('#mainNav').css('position', 'relative');
			}
		else{
			$('#mainNav').css('position', 'fixed');
			}
		
		$('#mainNav').css('top', 0);
		
		if ($(window).width() < 768){
			$('#mainNav').css('height', 50);
			$('.ribbon-logo').css('width', 18);
			}
		else{
			$('#mainNav').css('height', 63);
			$('.ribbon-logo').css('width', 25);
			}
		
		$('#mainNav .summary').css('display', 'none');
		$('#mainNav .brand-header.brand-link').css('padding-left', 65);
		$('#mainNav .brand-header.brand-link .standard-chartered-logo-holder').css('display', 'block');
		$('#mainNav .brand-header.brand-link .standard-chartered-logo-holder').css('top', 11);
		$('#mainNav .brand-header .nav-bar > li > a:first-child').css('padding-top', 18);
		$('.ribbon-logo').css('display', 'block');
		$('.mob-scb-logo').css('display', 'none');
		
		//----close login box----
		
		$('.login-box-content ul.dropdown').slideUp('fast');
		$('.login-box-content').css('background', '#22aa48');
		
		$('.search-box-content ul.dropdown1').slideUp('fast');
		$('.search-box-content').removeClass('active');
		
		if(isModalOpen){
			
			}
		else{
			if(!isHomepage){
				$('#loginBox').css('display', 'block');
				$('#loginBox').css('visibility', 'visible');
				}
			}
		
		if(isHomepage){
			// if($(window).width() < 768){
			// 	$("#extendLogin").slideUp();
			// 	$("#loginBox").removeClass("login-open");
			// }
		}
		
		}
	else{
		$('.empty-logo-bar').css('display', 'none');
		$('#mainNav').css('position', 'relative');
		$('#mainNav').css('top', 0);
		$('#mainNav').css('height', 'auto');
		$('#mainNav .summary').css('display', 'block');
		$('#mainNav .brand-header.brand-link').css('padding-left', 0);
		$('.ribbon-logo').css('display', 'none');
		
	
		if ($(window).width() > 767){
			$('.ribbon-logo').css('display', 'none');
			$('.mob-scb-logo').css('display', 'none');
			
			if(isHomepage){
				$("#extendLogin").slideDown();
				$("#loginBox").addClass("login-open");
				$("#loginBox").show();
				}
			}
		else{
			$('.mob-scb-logo').css('display', 'block');
			
			if(isHomepage){
				//$("#extendLogin").slideUp();
				$("#loginBox").removeClass("login-open");
				$("#loginBox").hide();
				}
			}
		
		//----open login box----
		if(isModalOpen){
			
			}
		else{
			//$('#loginBox').css('display', 'block');
			//$('#loginBox').css('visibility', 'visible');
			}
		
		
		
		}
	}

