function resizeIframe(){
	$(".c-iframe").each(function(){
		if($(window).width() < 768){
			$(this).height($(this).parent().data("m-height"));
		}else{
			$(this).height($(this).parent().data("height"));
		}
	});
}

$(document).ready(function(){
	if($("body").hasClass("home-page") && !$("body").hasClass("page-priority"))
		$(".ftr-lnk-speak-up").css("display","inline-block");
	else
		$(".ftr-lnk-speak-up").hide();
	resizeIframe();
});

$(window).resize(function(){resizeIframe();});

$(document).ready(function(){
			if(this.megaNavJson == undefined){
				return;
				}
			
			var loginbox = $("#extendLogin .login-wrapper");
			var menuContainer = $("#megaNav");
			
			if($("#megaNav>li").length == 0){
				$("#extendLogin").width(220);
				var l_loginBox = this.megaNavJson.loginbox;
				for(var i = 0; i < l_loginBox.length; i++){
					var l_h6 = $("<h6/>").appendTo(loginbox);
					var l_a = $("<a/>").addClass("lock-ext").attr("href", l_loginBox[i].url).text(l_loginBox[i].name).appendTo(l_h6);
					if(l_loginBox[i].external)
						l_a.addClass("external-link");
				}
				

				var l_meganav = megaNavJson.meganav;
				for(var i = 0; i < l_meganav.length; i++){
					var l_mainMenu =$("<li><a href=\"" + l_meganav[i].url + "\"><h3>" + l_meganav[i].name + "</h3><span class=\"summary\">" + l_meganav[i].description + "</span></a><a href=\"#\" class=\"flyout-toggle\"><span></span></a></li>")
					.appendTo(menuContainer);

					var l_cols = l_meganav[i].children;
					if(l_cols.length){
						l_mainMenu.addClass("has-flyout");
						if(i == 5)
							l_mainMenu.addClass("insure insure-updates");
						var l_flyoutContainer = $("<div/>").addClass("flyout large").appendTo(l_mainMenu);
						var l_row = $("<div/>").addClass("row collapse").appendTo(l_flyoutContainer);
						for(var ii = 0; ii < l_cols.length; ii++){
							var l_col = $("<div/>").addClass("three columns").appendTo(l_row);
							var l_ul = $("<ul/>").appendTo(l_col);
							var l_li = $("<li/>").appendTo(l_ul);
							var l_components = l_cols[ii];
							for(var iii = 0; iii < l_components.length; iii++){
								var l_component = l_components[iii];
								if(l_component.header){
									var l_header = $("<h4/>").html(l_component.header).appendTo(l_li);
									if(l_component.icon)
										l_header.addClass("subheader mega-icon " + l_component.icon);
									if(l_component.subHeader)
										$("<h6/>").addClass("subheader no-icon").html(l_component.subHeader).appendTo(l_li);
									if(l_component.url){
										l_header.html(l_header.html() + "&nbsp;" + "<a href=\"" + l_component.url + "\">&raquo;</a>");
									}
								}else if(l_component.promo){
									var l_articleContainer = $("<div/>").addClass("sub-menu-article text-link").appendTo(l_li);
									var l_article = $("<article/>").addClass("banner-block").appendTo(l_articleContainer);
									var l_imgLink = $("<a/>").attr("href",l_component.url).appendTo(l_article);
									$("<img/>").attr("src", l_component.image).attr("alt", l_component.promo).appendTo(l_imgLink);
									if(l_component.description)
										$("<p/>").css("margin","0 0 10px 0").addClass("text-left").html(l_component.description).appendTo(l_article);
									if(l_component.cta){
										$("<a/>").addClass("button radius green").attr("href", l_component.ctaUrl || l_component.url).html(l_component.cta).appendTo(l_article);	
									}
								}else if(l_component.menu){
									var l_menuContainer = $("<div/>").addClass("sub-menu-article text-link").appendTo(l_li);
									var l_ul = $("<ul/>").addClass("grey-arrow").appendTo(l_menuContainer);
									var l_menu = l_component.menu;
									for(var iiii = 0; iiii < l_menu.length; iiii++){
										var l_innerLi = $("<li/>").appendTo(l_ul);
										var l_a = $("<a/>").html(l_menu[iiii].name).appendTo(l_innerLi);
										if(l_menu[iiii].disclaimer){
											var l_dMenu = l_menu[iiii];
											l_a.click(function(){
												popDisclaimerAdv(l_dMenu.url,l_dMenu.disclaimer.id,l_dMenu.disclaimer.openmode);
											});
										}else{
											l_a.attr("href", l_menu[iiii].url);
											if(l_menu[iiii].external)
												l_a.addClass("extrnal-link");	
										}
										
									}
								}else if(l_component.iconmenu){
									var l_menuContainer = $("<div/>").addClass("sub-menu-article text-link big-text").appendTo(l_li);
									var l_menu = l_component.iconmenu;
									for(var iiii = 0; iiii < l_menu.length; iiii++){
										var l_article = $("<article/>").addClass(l_menu[iiii].icon + " mega-icon-a").appendTo(l_menuContainer);
										var l_h6 = $("<h6/>").addClass("subheader").appendTo(l_article);
										var l_a = $("<a/>").attr("href", l_menu[iiii].url).text(l_menu[iiii].name).appendTo(l_h6);
										if(l_menu[iiii].external)
											l_a.attr("target", "_blank");
									}	
								}else if(l_component.whitemenu){
									var l_menuContainer = $("<div/>").addClass("sub-menu-article text-link").appendTo(l_li);
									var l_menuArticle = $("<article/>").addClass("other-cat non-cat-block").appendTo(l_menuContainer);
									var l_ul = $("<ul/>").addClass("link-blocks obs cf").appendTo(l_menuArticle);
									var l_menu = l_component.whitemenu;
									for(var iiii = 0; iiii < l_menu.length; iiii++){
										$("<li><a href=\"" + l_menu[iiii].url + "\">" + l_menu[iiii].name + "</a></li>").appendTo(l_ul);
									}
								}
							}
						}
					}
				}
				$("#megaNav>li>a").each(function(){
					if(location.pathname.indexOf($(this).attr("href")) > -1){
						$(this).css("border-bottom-color", "#29ad48");
						$($(this).children()[0]).css("color", "#29ad48");
					}
				});
				$(".has-flyout").mouseenter(function(){
					$($(this).children()[2]).show();
				}).mouseleave(function(){
					$($(this).children()[2]).hide();
				});
				$("#mainNav").show();
				$('a.external-link').attr("target", "_blank");
			}
		});
		
		
		
