$(".language-selected").click(function(){
  $(".language-dropdown ul").toggle();
});  
$(".language-dropdown ul li a").click(function(){
  var atext = $(this).text();
  $(".language-dropdown ul").hide();
  $(".language-selected").html(atext);
});

